import React from "react";
import "./testimonial.css";

const Testimonial = () => {
  return (
    <>
      <div className="testimonial">
        <div className="test-top">
          <div className="test-left">
            <div className="bar"></div>
            <span></span>
          </div>
          <div className="test-right"></div>
        </div>
      </div>
    </>
  );
};
export default Testimonial;
